import { useContext, useState } from "react";
import SearchListInput from "./SearchListInput/SearchListInput";
import SearchListItem from "./SearchListItem/SearchListItem";
import ExpenseList from "../../../UI/ExpenseList/ExpenseList";
import ExpenseDataContext from "../../../../store/expenseData/expenseData--context";
import SearchListDataContext from "../../../../store/searchListData/searchListData--context";
import style from "./SearchList.module.css";

function SearchList() {
  const searchExpenseDataCtx = useContext(SearchListDataContext);

  console.log(searchExpenseDataCtx.expenseData);
  return (
    <div className={style.search}>
      <SearchListInput />
      {searchExpenseDataCtx.expenseData.length !== 0 ? (
        <ExpenseList
          data={searchExpenseDataCtx.expenseData}
          classItem={style.item}
        />
      ) : (
        <p className={style.noData}>No Data</p>
      )}
    </div>
  );
}

export default SearchList;
